§ 2. Als Ausländer im Sinne dieses Gesetzes gelten: 
 1. natürliche Personen, welche die österreichische Staatsbürgerschaft nicht besitzen; 
 2. juristische  Personen  sowie  rechtsfähige  Personengesellschaften,  die  ihren  satzungsgemäßen  Sitz 
im Ausland haben; 
 3. juristische  Personen  sowie  rechtsfähige  Personengesellschaften  mit  dem  satzungsgemäßen  Sitz 
im Inland, an denen Ausländer im Sinne der Z 1 oder 2 überwiegend beteiligt sind;

d) im   Rahmen   des   in   der   Richtlinie   2004/38/EG   (Amtsblatt   der   Europäischen   Union 
Nr. L 158/77 vom 30.4.2004) normierten Aufenthaltsrechtes oder 
 e) zum  Zweck  von  Direktinvestitionen,  Immobilieninvestitionen  oder  sonstigen  Geschäften  des 
Kapitalverkehrs gemäß Art. 40 des Abkommens über den Europäischen Wirtschaftsraum zum 
Rechtserwerb an Grundstücken oder Teilen davon berechtigt sind; 
 3. soweit ihnen andere staatsvertragliche Verpflichtungen entgegenstehen;

